class qrtable(ListView):
    print("HTML: qrtableの発行!!")
    # DBを表示したいから、listviewとかでいいかも、grid.js使いたい気持ちある
    template_name = "qrtable.html"
    model = regist_table
    ordering = "-regist_id"
    paginate_by = 2


    def post(self, request, *args, **kwargs):
        form_value = [
            self.request.POST.get('regist_id', None),
            self.request.POST.get('title', None),
            self.request.POST.get('text', None),
        ]
        request.session['form_value'] = form_value
        # 検索時にページネーションに関連したエラーを防ぐ
        self.request.GET = self.request.GET.copy()
        self.request.GET.clear()
        return self.get(request, *args, **kwargs)
        
    def get_context_data(self, **kwargs):
        context = super().get_context_data(**kwargs)
        # sessionに値がある場合、その値をセットする。（ページングしてもform値が変わらないように）
        regist_id = ''
        title = ''
        text = ''
        if 'form_value' in self.request.session:
            form_value = self.request.session['form_value']
            regist_id = form_value[0]
            title = form_value[1]
            text = form_value[2]
        default_data = {'regist_id':regist_id, # 登録ID
                        'title': title,  # タイトル
                        'text': text,  # 内容
                        }
        test_form = SearchForm(initial=default_data) # 検索フォーム
        context['test_form'] = test_form
        return context
    def get_queryset(self):
        # sessionに値がある場合、その値でクエリ発行する。
        if 'form_value' in self.request.session:
            form_value = self.request.session['form_value']
            regist_id = form_value[0]
            title = form_value[1]
            text = form_value[2]
            # 検索条件
            condition_title = Q()
            condition_text = Q()
            condition_regist_id = Q()
            if len(regist_id) != 0 and regist_id[0]:
                condition_regist_id = Q(regist_id__contains=regist_id)
            if len(title) != 0 and title[0]:
                condition_title = Q(title__icontains=title)
            if len(text) != 0 and text[0]:
                condition_text = Q(text__contains=text)
            return regist_table.objects.select_related().filter(condition_regist_id & condition_title & condition_text)
        else:
            # 何も返さない
            return regist_table.objects.none()

