# 元URLがすでに登録済でないかを確認する
def chk_seturl(chk_url):
    """
    docs:URLが重複してリダイレクトに支障が出るのを防止する為に登録済か確認する
    params
    chk_url:クライアントから与えられたURL(登録済の場合は、権限を使って変更する)
    """
    print("URLがすでに設定済のものでないか確認します。")
    model = regist_table
    urls = model.objects.filter(my_seturl=chk_url)
    print(urls.first())
    if urls.first() == None:
        print("登録なし")
        chk_url = 0
    else:
        print("登録済")
        chk_url = 1
    return chk_url


def create_ajax(request):
    print("view_create")
    if request.POST:
        """
        docs: URLを元に、QRコードを生成する
        flow: 短縮URL→QR生成→Base64変換→レンダリング
        """
        # QRコードの生成
        if request.POST.get('create_mode')=="create":
            print("view_create_ajax")
            print("QRコード生成のAjax")
            get_url = request.POST.get('get_url')
            get_usage = request.POST.get('get_usage')
            get_explain = request.POST.get('get_explain')
            get_flg_shorturl = request.POST.get('get_flg_shorturl')

            if get_url:
                # URLの登録状況確認
                if chk_seturl(get_url) == 0:
                    if get_flg_shorturl == "on":    # 短縮URL
                        print("短縮URL変換")
                        #get_url = url_shortner(get_url)
                        print(request.META.get("HTTP_HOST"))
                        get_url = str(request.META.get("HTTP_HOST")) + "/access_shortner/" + str(uuid.uuid1())
                        #get_url = "https://myDomainName/" + str(uuid.uuid1())
                        print("UUID: ", str(get_url))

                    # 画像生成
                    img_qr = qrcode.make(get_url)
                    #img_qr = qrcode.QRCode(version=1, box_size=10, border=5)
                    #qr.add_data('https://myDomainName/')
                    #np.array(img).save("some_file.png")    # QRコード画像の保存
                    #mg = qr.make_image(fill_color="black", back_color="white")

                    # 画像base64変換
                    buffer = BytesIO()
                    img_qr.save(buffer, format="PNG")
                    image_binary = buffer.getvalue()

                    img_qr_res = base64.b64encode(buffer.getvalue()).decode().replace("'", "")
                    error_flag = 0
                    
                    # DBに画像の一時登録
                    # モデルのImageFieldに保存する_できるやつ
                    try:
                        qr_code = temp_image.objects.get(image_id=0)
                        qr_code.image.delete()
                    except:
                        qr_code = temp_image()

                    #print(qr_code)
                    qr_code.image.save('qrcode_temp.png', ContentFile(image_binary), save=True)
                    qr_code.save()
                    print("一時保存生成！")
                else:
                    # URLが登録済み
                    img_qr_res = get_dont_genim()
                    error_flag = 2

            else:
                # URLがない
                print("URLがないので、QRコードを生成しない")
                #img = Image.open("/gen_qr/static/imgs/item/dont_gen_qr.png")
                #get_url = "NonQRURL"
                img_qr_res = get_dont_genim()
                error_flag = 1
        
        # 登録ボタンが押されたとき
        elif request.POST.get('create_mode')=="regist":
            print("view_create_ajax_DB登録")
            get_url = request.POST.get('get_url')
            get_usage = request.POST.get('get_usage')
            get_explain = request.POST.get('get_explain')
            get_flg_shorturl = request.POST.get('get_flg_shorturl')
            result_qr_base64 = request.POST.get('result_qr')
            print(get_url)

            if get_url:
                # QRコード作成
                get_flg_shorturl = str(get_flg_shorturl[6:])
                error_flag = 0

                # 画像は一時保存の画像を使う
                qrcode_temp = temp_image.objects.get(image_id=0).image    # 画像のパスを取得

                # 画像base64変換(一時ファイルを読み込んで、再表示用にBase64化)
                img_qr = Image.open(qrcode_temp)
                buffer = BytesIO()
                img_qr.save(buffer, format="PNG")
                image_binary = buffer.getvalue()
                img_qr_res = base64.b64encode(buffer.getvalue()).decode().replace("'", "")


                # DB登録する
                model = regist_table
                print("登録、短縮→元URL")
                use_id = len(regist_table.objects.all())
                print("既登録数（登録のID作成用）",str(use_id))
                model_regist = model(regist_id=use_id+1, my_shorturl=get_flg_shorturl, my_seturl=get_url, image=qrcode_temp)
                model_regist.save()
                print("登録完了")

                # HTMLに表示するURL
                get_url = get_flg_shorturl

            else:
                print("登録できるURLがないので、QRコードを生成しない")
                #img = Image.open("/gen_qr/static/imgs/item/dont_gen_qr.png")
                #get_url = "NonQRURL"
                img_qr_res = get_dont_genim()
                error_flag = 1

        d = {
            "qr": img_qr_res,
            "path_id": "create_qr_img_0001",
            "error_flag": error_flag,
            "level_review": 5,
            "level_a": 3,
            "level_b": 3,
            "level_c": 2,
            "level_d": 3,
            "level_e": 4,
            "URL":get_url,
            "create_mode":request.POST.get('create_mode'),
        }

        print("ajax反映！！！")
        #print(d)
        return JsonResponse(d, safe=False)


